import { createMuiTheme } from '@material-ui/core'

const myTheme = createMuiTheme({
    palette: {
        primary: {
            main: "#faef5a"
        }
    },
    typography: {
        fontFamily: [
        'Poppins',
        'light',
        ].join(','),
        fontWeight: 500,

    },
    overrides: {
        MUIDataTable: {
          responsiveScroll: {
          maxHeight: '980px'
          }
      }}
})

export default myTheme;
